-- ----------------------------
-- Table structure for `think_customer`
-- ----------------------------
DROP TABLE IF EXISTS `think_customer`;
CREATE TABLE `think_customer` (
  `id` mediumint(6) NOT NULL AUTO_INCREMENT,
  `Userid` mediumint(6) DEFAULT NULL COMMENT '创建者ID(用户)',
  `ConsultDate` varchar(10) NOT NULL COMMENT '咨询时间',
  `sremind` varchar(10) NOT NULL COMMENT '业务员回访时间',
  `dremind` varchar(10) NOT NULL COMMENT '设计师回访时间',
  `premind` varchar(10) NOT NULL COMMENT '工程监理回访时间',
  `CName` varchar(50) NOT NULL COMMENT '客户姓名',
  `Tel` varchar(11) NOT NULL COMMENT '联系方式',
  `Address` varchar(255) NOT NULL COMMENT '所在小区',
  `Space` decimal(8,2) NOT NULL COMMENT '面积',
  `Way` mediumint(6) NOT NULL COMMENT '装修方式',
  `Channel` mediumint(6) NOT NULL COMMENT '渠道',
  `Designer` mediumint(6) NOT NULL COMMENT '设计师ID',
  `Project` mediumint(6) NOT NULL COMMENT '工程监理人员ID',
  `State` varchar(100) NOT NULL COMMENT '状态',
  `ComeTime` varchar(10) NOT NULL COMMENT '到店时间',
  `OrderTime` varchar(10) NOT NULL COMMENT '签单时间',
  `HetongTime` varchar(10) NOT NULL COMMENT '合同时间',
  `OrdersValue` decimal(12,2) NOT NULL COMMENT '单值',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1-删除',
  `StartTime` varchar(10) NOT NULL COMMENT '开工时间',
  `EndTime` varchar(10) NOT NULL COMMENT '竣工时间',
  `Number` varchar(100) NOT NULL COMMENT '合同编号',
  `Deposit` decimal(12,2) NOT NULL COMMENT '定金金额',
  `Captain` mediumint(8) NOT NULL COMMENT '工长ID[施工队长]',
  `Drawing` mediumint(8) NOT NULL COMMENT '制图员',
  `Material` mediumint(8) NOT NULL COMMENT '材料员',
  `xiaoguotu` mediumint(8) NOT NULL COMMENT '效果图制图员ID',
  `jiaofangtime` varchar(10) NOT NULL COMMENT '交房时间',
  `liangfangtime` varchar(10) NOT NULL COMMENT '量房时间',
  `huxing` varchar(50) NOT NULL COMMENT '户型',
  `dpid` mediumint(10) NOT NULL COMMENT '部门ID -弃用',
  `fixed` varchar(12) NOT NULL COMMENT '固定电话',
  `shejifei` decimal(8,2) NOT NULL COMMENT '设计费',
  `guanlifei` decimal(8,2) NOT NULL COMMENT '管理费',
  `qingfu` decimal(8,2) NOT NULL COMMENT '轻工辅料',
  `zhucai` decimal(8,2) NOT NULL COMMENT '主材费用',
  `once` decimal(8,2) NOT NULL COMMENT '第一笔人工费',
  `twice` decimal(8,2) NOT NULL COMMENT '第二笔人工费',
  `tirth` decimal(8,2) NOT NULL COMMENT '第三笔人工费',
  `others` decimal(8,2) NOT NULL COMMENT '其他费用',
  `IDNo` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `Birthday` varchar(255) DEFAULT NULL COMMENT '生日',
  `Profession` varchar(255) DEFAULT NULL COMMENT '职业',
  `IM` varchar(255) DEFAULT NULL COMMENT 'QQ/微信',
  `RoomType` varchar(255) DEFAULT '' COMMENT '房屋类型',
  `Style` varchar(255) DEFAULT NULL COMMENT '风格',
  `Address2` varchar(255) DEFAULT NULL COMMENT '装修地址',
  `CancelDate` varchar(255) DEFAULT NULL COMMENT '退定时间',
  `CancelAmount` varchar(255) DEFAULT NULL COMMENT '退定金额',
  `CAD` varchar(255) DEFAULT NULL COMMENT 'CAD图',
  `Pic` varchar(255) DEFAULT NULL COMMENT '效果图',
  `DiscountCode` varchar(255) DEFAULT NULL COMMENT '优惠活动编号',
  `Detail` text COMMENT '活动详情',
  `FirstPay` varchar(255) DEFAULT NULL COMMENT '首期款',
  `FirstPayDate` varchar(255) DEFAULT NULL COMMENT '首期款日期',
  `MidPay` varchar(255) DEFAULT NULL COMMENT '中期款',
  `MidPayDate` varchar(255) DEFAULT NULL COMMENT '中期款日期',
  `EndPay` varchar(255) DEFAULT NULL COMMENT '尾款',
  `EndPayDate` varchar(255) DEFAULT NULL COMMENT '尾款日期',
  `Content` varchar(255) DEFAULT NULL,
  `taochan` varchar(255) DEFAULT NULL,
  `zaojia` varchar(255) DEFAULT NULL,
  `level` varchar(255) DEFAULT NULL,
  `FirstPay2` varchar(255) DEFAULT NULL,
  `MidPay2` varchar(255) DEFAULT NULL,
  `EndPay2` varchar(255) DEFAULT NULL,
  `men` varchar(255) DEFAULT NULL,
  `chuju` varchar(255) DEFAULT NULL,
  `diban` varchar(255) DEFAULT NULL,
  `diaoding` varchar(255) DEFAULT NULL,
  `shuidian` varchar(255) DEFAULT NULL,
  `xiaojian` varchar(255) DEFAULT NULL,
  `bizhi` varchar(255) DEFAULT NULL,
  `longtou` varchar(255) DEFAULT NULL,
  `xiaogui` varchar(255) DEFAULT NULL,
  `weishengjian` varchar(255) DEFAULT NULL,
  `chufang` varchar(255) DEFAULT NULL,
  `gongqi` varchar(255) DEFAULT NULL,
  `yanqi` varchar(255) DEFAULT NULL,
  `baoxiuriqi` varchar(255) DEFAULT NULL,
  `zuobian` varchar(255) DEFAULT NULL,
  `CancelTime` varchar(10) DEFAULT NULL,
  `CancelDeposit` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`,`Userid`,`Way`,`Channel`,`Designer`,`Project`,`Captain`,`Drawing`,`Material`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=1182 DEFAULT CHARSET=utf8 CHECKSUM=1;

