  `auth` tinyint(1) NOT NULL DEFAULT '0' COMMENT '授权记录: 1-授权   0-未授权',
  `ifpay` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否付费 1-付费  0-未付费',
  `status` tinyint(1) unsigned NOT NULL COMMENT '删除标记: 1-删除',
  `flag` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '账户标记: 0-普通账户, 1-赠送账户',
  PRIMARY KEY (`id`),
  KEY `id` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED;

-- ----------------------------
-- Records of think_users
-- ----------------------------

