-- Records of think_users_group
-- ----------------------------

-- ----------------------------
-- Table structure for `think_user_defined`
-- ----------------------------
DROP TABLE IF EXISTS `think_user_defined`;
CREATE TABLE `think_user_defined` (
  `uid` mediumint(6) NOT NULL COMMENT ' 用户ID',
  `display_field` varchar(255) NOT NULL COMMENT '客户列表显示的字段集合',
  `project_field` varchar(250) NOT NULL COMMENT '工程管理客户列表显示字段结婚',
  `theme` varchar(20) NOT NULL COMMENT '主题颜色',
  `state` varchar(255) NOT NULL COMMENT '客户状态',
  `pstate` varchar(50) NOT NULL COMMENT '工程状态',
  `work_project_field` varchar(255) DEFAULT NULL,
  `work_field` varchar(255) DEFAULT NULL,
  `wpstate` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

