-- Records of think_user_defined
-- ----------------------------

-- ----------------------------
-- Table structure for `think_way`
-- ----------------------------
DROP TABLE IF EXISTS `think_way`;
CREATE TABLE `think_way` (
  `id` mediumint(8) NOT NULL AUTO_INCREMENT,
  `admin_id` mediumint(8) NOT NULL COMMENT '添加人员ID',
  `wayname` varchar(50) NOT NULL COMMENT '装修方式',
  `sort` mediumint(8) NOT NULL DEFAULT '0' COMMENT ' 排序',
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

