-- Records of think_way
-- ----------------------------

-- ----------------------------
-- Table structure for `think_wechat_auth`
-- ----------------------------
DROP TABLE IF EXISTS `think_wechat_auth`;
CREATE TABLE `think_wechat_auth` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `cid` tinyint(1) NOT NULL COMMENT '身份id   0-员工  1-业主',
  `uid` mediumint(8) NOT NULL COMMENT '用户ID  员工对应users表  业主对应customer_platform表',
  `openid` varchar(28) NOT NULL COMMENT '用户的标识，对当前公众号唯一',
  `username` varchar(16) NOT NULL COMMENT '用户名 和  crm注册用户名一致',
  `createtime` datetime NOT NULL COMMENT '验证身份时间',
  `status` tinyint(1) NOT NULL COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of think_wechat_auth
-- ----------------------------

-- ----------------------------
-- Table structure for `think_work`
-- ----------------------------
DROP TABLE IF EXISTS `think_work`;
CREATE TABLE `think_work` (
  `id` mediumint(6) NOT NULL AUTO_INCREMENT,
  `Userid` mediumint(6) NOT NULL COMMENT '创建者ID(用户)',
  `Company` varchar(255) DEFAULT NULL COMMENT '客户名称',
  `Contact` varchar(255) DEFAULT NULL COMMENT '客户联系人',
  `Position` varchar(255) DEFAULT NULL COMMENT '客户联系人职务',
  `Tel` varchar(11) NOT NULL DEFAULT '' COMMENT '客户联系电话',
  `Channel` mediumint(6) NOT NULL DEFAULT '0' COMMENT '客户来源渠道',
  `ThirdBiz` varchar(255) DEFAULT NULL COMMENT '第三方业务',
  `Address` varchar(255) NOT NULL DEFAULT '' COMMENT '项目地址',
  `Space` decimal(8,2) DEFAULT NULL COMMENT '项目面积',
  `Type` varchar(255) DEFAULT NULL COMMENT '项目类型',
  `Amount` varchar(255) DEFAULT NULL COMMENT '项目总价',
  `Content` varchar(255) DEFAULT NULL COMMENT '项目祥情',
  `ConsultDate` varchar(10) NOT NULL COMMENT '咨询时间',
  `Manager` varchar(255) DEFAULT NULL COMMENT '跟单负责人',
  `Designer` varchar(255) DEFAULT NULL COMMENT '跟单团队',
  `State` varchar(100) NOT NULL DEFAULT '' COMMENT '状态',
  `Way` mediumint(6) NOT NULL COMMENT '装修方式',
  `Remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` tinyint(3) DEFAULT '0',
  `rengongfei` text,
  `fukuanjihua` text,
  `level` varchar(255) DEFAULT NULL,
  `Project` varchar(255) DEFAULT NULL,
  `hetongbianhao` varchar(255) DEFAULT NULL,
  `cailiaoyuan` varchar(255) DEFAULT NULL,
  `kaigongshijian` varchar(255) DEFAULT NULL,
  `jungongshijian` varchar(255) DEFAULT NULL,
  `zhibaojin` varchar(255) DEFAULT NULL,
  `zhibaodaoqi` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`,`Userid`,`Way`,`Channel`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 CHECKSUM=1;

-- ----------------------------
-- Records of think_work
-- ----------------------------

-- ----------------------------
-- Table structure for `think_work_attached`
-- ----------------------------
DROP TABLE IF EXISTS `think_work_attached`;
CREATE TABLE `think_work_attached` (
  `customer_id` mediumint(8) NOT NULL COMMENT '客户ID',
  `del_name` mediumint(8) NOT NULL COMMENT '删除人',
  `del_time` varchar(10) NOT NULL COMMENT '删除时间(客户信息)',
  `entrytime` varchar(10) NOT NULL COMMENT '录入时间(客户信息)',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '客户状态',
  `markcolor` varchar(255) NOT NULL COMMENT '标记颜色 1-业务 2-设计',
  KEY `customer_id` (`customer_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

