-- ----------------------------
-- Table structure for `think_work_platform`
-- ----------------------------
DROP TABLE IF EXISTS `think_work_platform`;
CREATE TABLE `think_work_platform` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `admin_id` mediumint(8) NOT NULL COMMENT '公司ID==管理员ID',
  `uid` mediumint(8) NOT NULL COMMENT '添加人ID',
  `customer_id` mediumint(8) NOT NULL COMMENT '客户ID',
  `cusname` varchar(20) NOT NULL COMMENT '客户登录名称',
  `password` varchar(20) NOT NULL COMMENT '客户登录密码',
  `project` varchar(500) NOT NULL COMMENT '工序ID',
  `open` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 0为开启  1为关闭',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

