  `thumb` varchar(250) NOT NULL COMMENT '缩略图',
  `content` text NOT NULL COMMENT '文章内容',
  `entrytime` varchar(10) NOT NULL COMMENT '插入时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

