  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '施工工序ID',
  `admin_id` mediumint(8) NOT NULL COMMENT '添加人ID:一般为公司管理人员',
  `pid` mediumint(8) NOT NULL DEFAULT '0' COMMENT '父级ID 默认为0',
  `pname` varchar(250) NOT NULL COMMENT '工序名称',
  `sort` mediumint(3) NOT NULL COMMENT '排序',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 1-不显示',
